Function Binary2String([String] $Yatak) {
    $byteList = [System.Collections.Generic.List[Byte]]::new()
    for ($i = 0; $i -lt $Yatak.Length; $i +=8) {
        $byteList.Add([Convert]::ToByte($Yatak.Substring($i, 8), 2))
    }
    return [System.Text.Encoding]::ASCII.GetString($byteList.ToArray())
}
Function HexaToByte([String] $data) {
    $data = $data.Replace("O","0").Replace("!","1").Replace("@","A")
    $bytes = New-Object -TypeName byte[] -ArgumentList ($data.Length / 2 * 1)
    $INT = 2 * 8
    for ($i = 0; $i -lt $data.Length; $i += 2 * 1) {
        $bytes[$i / 2 * 1] = [Convert]::ToByte($data.Substring($i,2 * 1), $INT)
    }
    return [byte[]]$bytes
}
  
